import React, { useEffect, useState } from "react";

const API_URL = "http://192.168.68.113:36147/queue";

const ApiTeste = () => {
  const [date, setDate] = useState([]);
  useEffect(() => {
    getQueue();
  }, []);
  const getQueue = async () => {
    try {
      const res = await fetch(API_URL);
      const data = await res.json();
      setDate(data.items);
      return data.items;
    } catch (error) {
      throw new Error("Error: ", error);
    }
  };
  console.clear();
  //   console.log("Date", date);
  //   console.log("Date", date[0].createdAt);
  return (
    <div>
      <h1>Teste</h1>
      <ul>
        {date.map((item, index) => (
          <li key={index}>{item.createdAt}</li>
        ))}
      </ul>
    </div>
  );
};

export default ApiTeste;
